import React from "react";
import Active from "../images/yellow-star.svg";
import Inactive from "../images/black-white-star.svg";

function ToggleImages() {
  return (
    <>
      <h1>Toggle images</h1>
      <div className="toggle-wrapper">
        <img className="active" src={Active} alt="yellow star" />

        <img className="inactive" src={Inactive} alt="black and white star" />
      </div>
    </>
  );
}

export default ToggleImages;
